import React from 'react'
import { Tag } from "@blueprintjs/core";

const Tags = () => {
    return(
        <div>
            <Tag  
            className="tags"
            minimal="true"
            interactive="true"
            intent="sucess"
            >
            Hello </Tag>

            <span class="bp3-tag .modifier">125</span>
        </div>
    );
}

export default Tags;
